import React from 'react';
import Head from 'next/head';
import Link from 'next/link';

const Home = () => {
  return (
    <React.Fragment>
      <Head>
        <title>Home - Nextron (with-javascript)</title>
      </Head>
      <div>
        <p>
          PLAY LEAGUE SANDBOX NOW
        </p>
        <button>DOWNLOAD</button>
      </div>
    </React.Fragment>
  );
};

export default Home;
